(25, 1, 'about us', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body><!--Page Header Start-->\r\n<section class=\"page-header\">\r\n<div class=\"page-header-bg\" style=\"background-image: url(assets/images/bre-1.jpg)\">&nbsp;</div>\r\n\r\n<div class=\"page-header-shape-1\"><img alt=\"\" src=\"assets/images/\" /></div>\r\n\r\n<div class=\"container\">\r\n<div class=\"page-header__inner\">\r\n<ul class=\"thm-breadcrumb list-unstyled\">\r\n	<li><a href=\"/\">Home</a></li>\r\n	<li><span>/</span></li>\r\n	<li>About Us</li>\r\n</ul>\r\n\r\n<h2>About Us</h2>\r\n</div>\r\n</div>\r\n</section>\r\n<!--Page Header End--><!--About Six Start-->\r\n\r\n<section class=\"about-six\" id=\"cert1\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-xl-6\">\r\n<div class=\"about-six__left\">\r\n<div class=\"about-six__img-box wow slideInLeft\" data-wow-delay=\"100ms\" data-wow-duration=\"2500ms\">\r\n<div class=\"about-six__img\"><img alt=\"\" src=\"assets/images/about-a.jpg\" /></div>\r\n\r\n<div class=\"about-six__help\">\r\n<div class=\"about-six__help-icon\">&nbsp;</div>\r\n\r\n<div class=\"about-six__help-content\">\r\n<p class=\"about-six__help-text\">We&rsquo;re always here<br />\r\nto help you</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-xl-6\">\r\n<div class=\"about-six__right\">\r\n<div class=\"section-title-three text-left\">\r\n<div class=\"section-title-three__sub-title-box\">\r\n<p class=\"section-title-three__sub-title\">Company Overview</p>\r\n\r\n<div class=\"section-title-three__shape\">&nbsp;</div>\r\n</div>\r\n\r\n<h2 class=\"section-title-three__title\">Adeline Bio &ndash; The Best Injection Third Party Manufacturing Company in India</h2>\r\n</div>\r\n\r\n<p class=\"about-six__text-1\">Partner with Adeline Bio for unparalleled expertise and unwavering dedication to elevating healthcare standards.</p>\r\n\r\n<p class=\"about-six__text-2\">Adeline Bio stands as a pioneer in the pharmaceutical industry, distinguishing itself as the premier Injection Third-Party Manufacturing Company in India. Our company is a WHO-GMP, GLP certified company with DCGI approved Injectable range. With a relentless focus on quality and innovation, we have established a strong reputation for manufacturing top-tier injectable. We offer a diverse range of injectable products across therapeutic areas, empowering our partners with comprehensive healthcare solutions. Adeline Bio&#39;s commitment to ethical practices, transparency, and customer satisfaction sets us apart in the industry.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<!--About Six End-->\r\n\r\n<div data-aos=\"zoom-in\" data-aos-duration=\"2000\">\r\n<section class=\"services-five \" id=\"cert2\">\r\n<div class=\"container\">\r\n<div class=\"services-five__inner\"><!--<div class=\"section-title-three text-center\">\r\n<div class=\"section-title-three__sub-title-box\">\r\n<p class=\"section-title-three__sub-title\">Our Top Services</p>\r\n\r\n<div class=\"section-title-three__shape\">&nbsp;</div>\r\n</div>\r\n\r\n<h2 class=\"section-title-three__title\">Covering All the Insurance<br />\r\nServices Fields</h2>\r\n</div>-->\r\n<div class=\"row\"><!--Services Five Single Start-->\r\n<div class=\"col-lg-3 col-md-6 col-sm-6\">\r\n<div class=\"item\">\r\n<div class=\"services-five__single\">\r\n<div class=\"services-five__img-box\">\r\n<div class=\"services-five__img\"><img alt=\"\" src=\"assets/images/our vision.jpg\" />\r\n<div class=\"services-five__hover-content\">\r\n<h4 class=\"services-five__hover-content-title ls kl\">Our Vision</h4>\r\n\r\n<p class=\"services-five__hover-content-text\">Our Vision at Adeline Bio is to lead the industry as the best injection third-party manufacturing company, pioneering innovation and excellence in pharmaceuticals.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"services-five__title-box\">\r\n<h4 class=\"services-five__title ls mj\">Our Vision</h4>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!--Services Five Single End--><!--Services Five Single Start-->\r\n\r\n<div class=\"col-lg-3 col-md-6 col-sm-6\">\r\n<div class=\"item\">\r\n<div class=\"services-five__single\">\r\n<div class=\"services-five__img-box\">\r\n<div class=\"services-five__img\"><img alt=\"\" src=\"assets/images/our mission.jpg\" />\r\n<div class=\"services-five__hover-content\">\r\n<h4 class=\"services-five__hover-content-title ls\">Our Mission</h4>\r\n\r\n<p class=\"services-five__hover-content-text\">Our Mission is to consistently provide pharmaceutical products of the highest quality, meeting and exceeding global standards while fostering partnerships built on trust and reliability.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"services-five__title-box\">\r\n<h4 class=\"services-five__title ls\">Our Mission</h4>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!--Services Five Single End--><!--Services Five Single Start-->\r\n\r\n<div class=\"col-lg-3 col-md-6 col-sm-6\">\r\n<div class=\"item\">\r\n<div class=\"services-five__single\">\r\n<div class=\"services-five__img-box\">\r\n<div class=\"services-five__img\"><img alt=\"\" src=\"assets/images/quality.jpg\r\n										\" />\r\n<div class=\"services-five__hover-content\">\r\n<h4 class=\"services-five__hover-content-title ls\">Quality Control</h4>\r\n\r\n<p class=\"services-five__hover-content-text\">At Adeline Bio, Quality Control is our unwavering commitment. Our state-of-the-art facilities and stringent processes ensure that every product leaving our premises is of the utmost quality and safety.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"services-five__title-box\">\r\n<h4 class=\"services-five__title ls\"><a href=\"#\">Quality Control</a></h4>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!--Services Five Single End--><!--Services Five Single Start-->\r\n\r\n<div class=\"col-lg-3 col-md-6 col-sm-6\">\r\n<div class=\"item\">\r\n<div class=\"services-five__single\">\r\n<div class=\"services-five__img-box\">\r\n<div class=\"services-five__img\"><img alt=\"\" src=\"assets/images/goal.jpg\" />\r\n<div class=\"services-five__hover-content\">\r\n<h4 class=\"services-five__hover-content-title ls\">Prioritization</h4>\r\n\r\n<p class=\"services-five__hover-content-text\">Our company&#39;s foundation is built on Prioritization &ndash; prioritizing the well-being of our customers, the efficacy of our products, making us your top choice for pharmaceutical outsourcing.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"services-five__title-box\">\r\n<h4 class=\"services-five__title ls\"><a href=\"#\">Prioritization</a></h4>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!--Services Five Single End--></div>\r\n</div>\r\n</div>\r\n</section>\r\n</div>\r\n<!--Why Choose Four Start-->\r\n\r\n<section class=\"why-choose-four\" id=\"cert3\">\r\n<div class=\"why-choose-four__bg-box\">\r\n<div class=\"why-choose-four__bg-one\" style=\"background-image: url(assets/images/update-10-02-2023/backgrounds/why-choose-four-bg-1.jpg);\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"why-choose-four__bg-box-two\">\r\n<div class=\"why-choose-four__bg-two\" style=\"background-image: url(assets/images/about-b.jpg);\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-xl-6 col-lg-6\">\r\n<div class=\"why-choose-four__left\">\r\n<div class=\"section-title-three text-left\">\r\n<div class=\"section-title-three__sub-title-box\">\r\n<p class=\"section-title-three__sub-title main\">Why Choose Us</p>\r\n</div>\r\n\r\n<h2 class=\"section-title-three__title mak\">Why Choose Adeline Bio ?</h2>\r\n</div>\r\n\r\n<p class=\"why-choose-four__text\">Choose Adeline Bio for uncompromising quality, global accessibility, and innovation. Our extensive product range, experienced team, and dedication to compliance ensure reliable pharmaceutical solutions. We prioritize our customers&#39; well-being and success, fostering trust through our customer-centric approach. Adeline Bio is your partner for excellence in injectable pharmaceuticals.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-xl-6 col-lg-6\">\r\n<div class=\"why-choose-four__right\">\r\n<ul class=\"list-unstyled why-choose-four__points\">\r\n	<li>\r\n	<div class=\"why-choose-four__points-icon-box\">\r\n	<div class=\"why-choose-four__points-icon\">&nbsp;</div>\r\n\r\n	<div class=\"why-choose-four__points-text\">\r\n	<p>Quality Assurance:</p>\r\n	</div>\r\n	</div>\r\n\r\n	<div class=\"why-choose-four__points-content-box\">\r\n	<p class=\"why-choose-four__points-content\">Quality Assurance: Adeline Bio maintains rigorous quality control measures, adhering to international standards, to ensure the highest quality injectable pharmaceuticals.</p>\r\n	</div>\r\n	</li>\r\n	<li>\r\n	<div class=\"why-choose-four__points-icon-box\">\r\n	<div class=\"why-choose-four__points-icon\">&nbsp;</div>\r\n\r\n	<div class=\"why-choose-four__points-text\">\r\n	<p>Innovation:</p>\r\n	</div>\r\n	</div>\r\n\r\n	<div class=\"why-choose-four__points-content-box\">\r\n	<p class=\"why-choose-four__points-content\">We are committed to research and development, constantly striving to introduce innovative medicines to address emerging healthcare challenges.</p>\r\n	</div>\r\n	</li>\r\n	<li>\r\n	<div class=\"why-choose-four__points-icon-box\">\r\n	<div class=\"why-choose-four__points-icon\">&nbsp;</div>\r\n\r\n	<div class=\"why-choose-four__points-text\">\r\n	<p>Global Reach:</p>\r\n	</div>\r\n	</div>\r\n\r\n	<div class=\"why-choose-four__points-content-box\">\r\n	<p class=\"why-choose-four__points-content\">As a leading injectables exporter in India, we have a well- established global distribution network, making our products readily accessible to clients worldwide.</p>\r\n	</div>\r\n	</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<!--Why Choose Four End--><!--About One Start-->\r\n\r\n<div data-aos=\"zoom-in-left\" data-aos-duration=\"2000\">\r\n<section class=\"about-one\" id=\"cert4\">\r\n<div class=\"about-one-bg wow slideInRight\" data-wow-delay=\"100ms\" data-wow-duration=\"2500ms\" style=\"background-image: url(assets/images/backgrounds/about-one-bg.png);\">&nbsp;</div>\r\n\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-xl-6\">\r\n<div class=\"about-one__right\">\r\n<div class=\"section-title text-left\">\r\n<div class=\"section-sub-title-box\">\r\n<p class=\"section-sub-title main\">Export</p>\r\n\r\n<div class=\"section-title-shape-1\"><img alt=\"\" src=\"assets/images/shapes/section-title-shape-1.png\" /></div>\r\n\r\n<div class=\"section-title-shape-2\"><img alt=\"\" src=\"assets/images/shapes/section-title-shape-2.png\" /></div>\r\n</div>\r\n\r\n<h2 class=\"section-title__title\">Leading Injectables Exporter in India - Adeline Bio</h2>\r\n</div>\r\n\r\n<p class=\"about-one__text-1\">Adeline Bio is India&#39;s leading injectables exporter, renowned for its unwavering commitment to quality and innovation in the pharmaceutical industry.</p>\r\n<!--<ul class=\"list-unstyled about-one__points\">\r\n                                <li>\r\n                                    <div class=\"icon\">\r\n                                        <i class=\"fa fa-check\"></i>\r\n                                    </div>\r\n                                    <div class=\"text\">\r\n                                        <p>Refresing to get such a personal touch.</p>\r\n                                    </div>\r\n                                </li>\r\n                                <li>\r\n                                    <div class=\"icon\">\r\n                                        <i class=\"fa fa-check\"></i>\r\n                                    </div>\r\n                                    <div class=\"text\">\r\n                                        <p>Duis aute irure dolor in reprehenderit in voluptate.</p>\r\n                                    </div>\r\n                                </li>\r\n                                <li>\r\n                                    <div class=\"icon\">\r\n                                        <i class=\"fa fa-check\"></i>\r\n                                    </div>\r\n                                    <div class=\"text\">\r\n                                        <p>Velit esse cillum dolore eu fugiat nulla pariatur.</p>\r\n                                    </div>\r\n                                </li>\r\n                            </ul>-->\r\n\r\n<p class=\"about-one__text-2\">The company&#39;s state-of-the-art manufacturing facilities adhere to the most stringent international standards. And also ensuring the production of safe and effective injectable pharmaceuticals. Adeline Bio&#39;s extensive product portfolio encompasses a wide range of therapeutic categories, including antibiotics, vaccines, and critical care injectables.What sets Adeline Bio apart is its relentless pursuit of excellence through research and development. The company continuously invests in cutting-edge technology and employs a dedicated team of experts who strive to bring life-saving and life-enhancing medicines to patients worldwide.Adeline Bio&#39;s commitment to quality, compliance, and ethical business practices has earned it a reputation as a preferred partner for pharmaceutical distribution on a global scale.</p>\r\n\r\n<div class=\"about-one__btn-call\">\r\n<div class=\"about-one__call\">\r\n<div class=\"about-one__call-icon\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-xl-5\">\r\n<div class=\"about-one__left\">\r\n<div class=\"about-one__img-box wow slideInRight\" data-wow-delay=\"100ms\" data-wow-duration=\"2500ms\">\r\n<div class=\"about-one__img\"><img alt=\"\" src=\"assets/images/import.jpg\" /></div>\r\n\r\n<div class=\"about-one__img-two\"><img alt=\"\" src=\"assets/images/expo.jpg\" /></div>\r\n\r\n<div class=\"about-one__experience\">\r\n<h2 class=\"about-one__experience-year\">30</h2>\r\n\r\n<p class=\"about-one__experience-text\">Years of<br />\r\nExperience</p>\r\n</div>\r\n\r\n<div class=\"about-one__shape-1\"><img alt=\"\" src=\"assets/images/shapes/about-one-shape-1.jpg\" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n</div>\r\n<!--About One End--></body>\r\n</html>', 'about-us', 'Pages/2f05zt8eJbvX2JVp860Mmh5MhK6uOvBLhhnheTbU.png', 'aboutus', 'aboutus', 'aboutus', 1, '2023-02-27 23:49:36', '2023-11-24 06:03:44'),
